import React, { Fragment, useEffect } from 'react';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import store from './store';
import Navbar from './Components/Navbar/Navbar';
import Dashboard from './Components/Dashboard/Dashboard'
import User from './Components/User/User';
import Alert from './Components/Layout/Alert'
import Landing from './Components/Landing/Landing';
import UpdateProfile from './Components/User/UpdateProfile';
import AddGoalCard from './Components/User/AddGoalCard';
import Login from './Components/Login/Login';
import Signup from './Components/Signup/Signup';
import setAuthToken from './utils/setAuthToken';
import PrivateRoute from './Components/Routing/PrivateRoute';
import { loadUser } from './actions/auth';
import './App.css';
import { Provider } from 'react-redux';


if (localStorage.token) {
  setAuthToken(localStorage.token)
};


const App = () => {
  useEffect(() => {
    store.dispatch(loadUser());
  }, []);
  return (
    <Provider store = {store}>
      <Router>
        <Fragment>
          <Navbar />
          <Route path='/' exact component={Landing} />
          <section className="container">
            <Alert />
            <Switch>
              <Route path='/signup' exact component={Signup} />
              <Route path='/login' exact component={Login} />
              <Route path='/my-account' exact component={User} />
              <PrivateRoute path='/dashboard' exact component={Dashboard} />
              <PrivateRoute path='/edit-profile' exact component={UpdateProfile} />
              <PrivateRoute path='/add-goalcard' exact component={AddGoalCard} />
            </Switch>
          </section>
        </Fragment>
      </Router>
    </Provider>
  );
}

export default App;
